h3. Requirements
* Create new IPC endpoint to return ixConfig file for Settings Module 
 !IPCM-60 mock up.PNG|thumbnail! 

[IPCM-60 Flowdock thread |https://www.flowdock.com/app/icg/ipc-manager-settings-module/threads/w4Vm7ABkwC1B4DVV-krfHhBOkCV]
* Create a place in the IPC API that returns data for a particular application's configuration as it currently exists in ixConfig. Additionally, the data returned for a particular application should only return data specified under a particular key. The reason for this is that developers can continue specifying all kinds of configuration options in their ixConfig file (like secrets, tokens, etc) which they don't want to surface via any UI. So putting data under a particular key is essentially the developer stating "I want these configuration settings to be visible to business users in IPC Manager"

Example use case from the front-end:

I need to retrieve the configuration settings for a particular app:

    Possible endpoint idea: /configurations/:appId
        Agent Portal:  /configurations/agentportal
        Policy Central:  /configurations/policycentral

Perhaps we should design right now for the idea of hitting the API and getting the "forms" response or getting just a list of key/value data or both?

For example, the immediate need is to hit the API for a particular app, which would result in something like the following:

    1. Client hits /configurations/agentportal
    2. API hits ixconfig and retrievs the entire file for Agent Portal in staging, which would something like this:

{code}
{
  "serviceToken": "1029a9d930s9d9e8f0ffas0e9",
  "ipcmForm": [
    {
      "id": "homeVideoUrl",
      "label": "Home Video URL",
      "value": "http://youtube.com/?watch=v39s0ad9",
      "type": "text"
    },
    // more "inputs" here...
  ]
}
{code}

    3. API looks specifically for the ipcmForm key and returns its value to the client, i.e.
{code}
[
  {
    "id": "homeVideoUrl",
    "label": "Home Video URL",
    "value": "http://youtube.com/?watch=v39s0ad9",
    "type": "text"
  },
  // more "inputs" here...
]
{code}

    4.  Client draws a form in IPC Manager based on that configuration.
In the example above, the client is fetching the form data as specified in ixconfig. I know Cuth and some of the folks from Infinity talked about the idea of separating out the values from the form specification in the ixconfig represtation. Perhaps that's something we should take into account in the API design? i.e. should you need one endpoint for getting the form representation and another endpoint for getting the values?

{code}
// API endpoint: /configurations/:app/form
[
  { id: "input1", label: "Input 1", type: "text" },
  { id: "input2", label: "Input 2", type: "text" }
]

// API endpoint: /configurations/:app/values
{
  input1: "http://youtube.com/?watch=1928s930sa",
  input2: "some other value here"
}
{code}

Or just endpoint for everything and then separate keys for values/form data, i.e.

{code}
// API endpoint: /configurations/:app
{
  formData: [
    { id: "input1", label: "Input 1", type: "text" },
    { id: "input2", label: "Input 2", type: "text" }
  ],
  formValuesById: {
    input1: "http://youtube.com/?watch=1928s930sa",
    input2: "some other value here"
  }
}
{code}

